[{'lang': 'main', 'text': "Cocoa Cream: Sugar, coconut oil, cocoa powde glucose, cocoa ss, whole milk powder, skimmed milk powder, dextrose, emulsifier (soy lecithin), hazelnut paste, natural identical flavor (vanilla), salt. Wafer Sheet: wheat flour (contain gluten), starch, emulsifier (soy lecithin), vegetable of moonut, palm) ast extract, salt, raising agents (sodium bicarbonate, sodium acid pyrophosphate). R Contenu: Creme au cacao: le sucre, L'huile de noix de coco, le cacao en poudre, glycose, la masse de cacao, le lait en poudre, lactoserum en creme extrose, émulsifiant (la lecithine de soja), la pate de noisette, L'arome naturel (vanille), le sel. Feuile de gaufret: Farine de ble (il contient le gluten), l'amidon, le cacao en poudre, émulsifiant (la lecithine de soja), huile végétale de coco palme), extraide levure, sel, les epispatiques (bi carbonat de sodium, acide de sodium bi phosphorat). DE ZUTATEN: Kakao-Creme: Zucker, Kokosnussöl, Kakaopulver, Glukose, Kakaomasse, Vollmilchpulver, Magermilchpulver, Dextro gr (Soja lecithin, Haselnusspaste, natürliches identisches Aroma (Vanille), Salz. Waffelblatt: Weizenmehl (enthält Gluten), Stärke, Emulgator (Soja lecithin), pflanzliche Öle (Kokos/Palm), Hefeextrakt, Salz, Backtriebmittel (Natrium bicara Na pyrophosph ESP Ingredientes: Crema de cacao: Azúcar, aceite de coco, cacao en polvo, glucosa, masa de cacao, leche entera en polvo, leche desnatada en polvo, dextrosa, emulsionante (lecitina de soja), pasta de avellana, atra identico (vania), sal. Hoja de oblea: Harina de trigo (contiene gluten), almidón, emulsionante (lecitina de soja), aceite vegetal (coco, palma), extracto de levadura, sal, gasificante (bicarbonato de sodio, pirofosfato de ácido de sodio). POR Creme de cacau Açúcar, óleo de coco, cacau em pó, glicose, massa de cacau, leite em pó integral, leite em pó desnatado, dextrose, emulsificante (lecitina de soja), pasta de avelã, sabor idêntico natural (baunilha), sal. Folha de bolata Farnha de trigo (contem glúten), amido, emulsificante (lecitina de soja), óleo vegetal (coco, palma), extrato de levedura, sal, agentes de aumento (bicarbonato de sódio, pirofosfato de sódio). (RO Ingrediente: Cremă cu Cacao: Zahăr, ulei de nuca de cocos, pudră de cacao, glucoză, masă de cacao, lapte praf gras, lapte praf degresat, dextroză, emulgator (lecitină de soia), piure de alune, aromă natural identică (vanilie), sare. Foitaj napolitană: Făină de grâu (conţine gluten), amidon, pudrà de cacao, emulgator (lecitina de soia), ulei vegetal (nucă de cocos, palmier), extract de drojdie, sare, agenți de creştere (bicarbonat de sodiu, pirofosfat acid de sodiu). (RUS) COCTAB: Kakao-кpeм: Caxap, KOкосOBOе мacлo, kakao-nopoulos, koja, kakao-vacca жирное сухое молоко, обезжиренное сухое молоко, декстроза, эмульгатор (соевый лецитин), пюре лесного ореха, идентичный натуральному ароматизатор (ванилин), соль. Вафельные листы: Пшеничная мука (содержит глютен, крахмал, какао-порошок, эмульгатор (соевый лецитин), растительное масло (кокосовое, пальмовое), дрожжевой экстракт, соль, разрыхлители (бикарбонат натрия, пирофосфат натриевой кислоты). المكونات: كريمة الكاكاو السكر ، زيت جوز الهند، مسحوق الكاكاو، الجلوكوز ، كتلة الكاكاو، مسحوق الحليب كامل الدسم، مسحوق الحليب منزوع الدسم، سكر العنب، مستحلب (ليسيثينا الصويا E322)، معجون البندق، نكهة الفانيليا) مطابقة للطبيعية ملح. رقائق الويفر: دقيق القمح ( يحتوي على الغلوتين) ، النشا، مستحلب (ليسيثين الصويا (322-E) ، الزيوت النباتية جوز الهند والنخيل)، خلاصة الخميرة، ملح ، عوامل رفع (بيكربونات الصوديوم E500)، بيروفوسفات حمض الصوديوم (E450) اجزاء کوکو کریم ،شوگر ناریل کا تیل کوکو پاؤثر گلوکوز کوکو ،ماس سارا دودھ ،پاؤڈر، سکیمڈ دودھ پاؤڈر ڈیکسٹروس، ملیسيفائر سويا ليسيثن E322)، بیزلنٹ پیسٹ، قدرتی ایک جیسے ذائقہ (وینیلا)، نمک وافر شیث گندم کا آٹا (جس میں گلوٹین ہوتا ہے، نشاستے ایملیسیفائر سوياليسيثن (E322)، سبزیوں کا تیل ناریل کھجور) خمیر کا ،عرق ،نمک ایجنٹ سوڈیم بائ کاربونیٹ E500 ، سوڈیم ایسڈ پاتر و فاسفیٹ (E450) ALERJEN UYARISI: Süt ürünü, soya lesitini, buğday gluteni ve fındık içerir. Eser miktarda badem, Antep fıstığı, yer fıstığı, ceviz, susam ve ürünleri, yumurta ve/veya ürünleri içerebilir./ALLERGEN WARNING: Contain dairy product, soy lecithin, wheat gluten and hazelnut. May contain trace amounts of almond, pistachio, walnut, peanut, sesame and its products, egg and/or products./L'AVERTISSEMENT POUR LES ALLERGENES: Cette produit peut contenir les produits laitiers et la lecithine de soja, et le gluten de ble et la noisette. Il peut contenir une peu de noisettes, amandes, pistaches, noix, arachides, sésame et ses produits, l'ceuf/produits de l'œuf.JALLERGEN WARNUNG: Enthält Milch produkte, Soja lecithin, Weizen gluten und Haselnüsse. Kann Spuren von Mandeln, Pistazien, Walnüssen, Erdnüssen, Sesam und deren Erzeugnisse, Ei und/oder Erzeugnisse enthalten. تحذير الحساسية: يحتوي على منتجات الألبان, ليسيثين الصويا, غلوتين القمح. قد يحتوي على كميات ضئيلة من البندق, اللوز, الفستق, الجوز الفول السوداني, السمسم ومنتجاته والبيض :المستورد تورين فود 42 مركز الاعمال عكاشة 1 شارع مولاي سليمان عين السبع الدار البيضاء - المغرب / 00212522357740 : FOOD Adrese: Par Dactivites Ouladha 1;bd Moulay Slimane Hangar No:42. Ain Sebaa. Casablanca - Maroc / TEL تورين ويفر / ويفر بنكهة كريمة الكاكاو الفاخر / AM FINEST COCOA FLAVOUR WAFER / TÖREN GAUFFRETTE AU CACAO FINE GARNIS A CREME AU CACAD"}
