е ВОЛокна), эмульгаторы (соевый лецитин, рапсовый лецитин), натуральный ароматизатор (ваниль), подсластитель (стевиол ГЛИКОЗИД), Общее содержание в шоколаде: сухого остатка какао — не менее 70%, Грансизомеров ненасыщенных жирных КИСЛОТ - О г/100 г, Продукт может содержать незначительные следы присутствия молока, фундука, миндаля, грецких орехов, орехов пекан, кешью, фисташек, яиц, пшеницы и ячменя, Содержит подсластители, При чрезмерном употреблении могут оказывать слабительное действие, С высоким содержанием пищевых волокон, AR - شكولاطة سوداء بدون سکر مضاف و تحتوي علي المواد المحلية بنكهة الفانيلا, تحتوي على سكريات متواجدة طبيعيا في حبات الكاكاو, شكولاطة مع الإيزومالت و الغليكوزيد من نبات ستيفيا, المكونات: عجينة الكاكاو, مضافات لأغراض غذائية )مواد محلية : ایزومالت غليكوزید ستيفيول، مستحلب: ليستين الصوجا(, مستحلبات )ليسيثين )الصويا، السلجم((، زبدة الكاكاو نكهة الفانيلا الطبيعية, کاكاو 70% كحد ادني, معلومات الحساسية: يحتوي علي الصوجا, قد تحتوي على اثار: الحليب البندق, ال لوز, الجوز, جوز البكان, الكاجو الفستق الحلبي, البيض القمح و الشعير, فد تؤدي الي الاسهال في حالة الاستهلاك المفرط, غنية بالألياف, لا ينصح به ل لأطفال, لا ينصح به ل لأشخاص ذوي الحساسية و/ أو الذين يعانون من عدم تحمل المضافات الغذائية, Informations nutritionnelles / Nährwertangaben /'}]

